export class User {
  constructor(email, id, dbUserId, _token, type, _tokenExpirationDate) {
    this.email = email;
    this.id = id;
    this.dbUserId = dbUserId;
    this._token = _token;
    this.type = type;
    this._tokenExpirationDate = _tokenExpirationDate;
  }

  getToken() {
    if (!this._tokenExpirationDate || new Date() > this._tokenExpirationDate) {
      return null;
    }

    return this._token;
  }

}
